import React from "react";

export const Tile = ({tiles}) => {
  return (
    <div className="tile-container">
      {/* {Object.values(tile).map((item, index) => (<p className={index === 0 ? "title-tile" : "tiles"}>{item}</p>))} */}
      {tiles.map((tile, index) => (
        <Tile key={index} tile={tile} description={{...tile}} className="tile-container"/>
      ))}
    </div>
  );
};

export default Tile;

